query.query:
query {
  todos {
    data {
      id
      title
      completed
      user {
        name
        email
      }
    }
    meta {
      totalCount
    }
  }
}

query {
  todos(options: {
    search: {
      q: "a' OR '1'='1"
    }
  }) {
    data {
      id
      title
    }
  }
}

